import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="emoji" alt="logo" />
        <div class="tenor-gif-embed" data-postid="11626218" data-share-method="host" data-width="100%" data-aspect-ratio="1.1851851851851851"><a href="https://tenor.com/view/emoji-smile-happy-gif-11626218">Emoji Smile GIF</a> from <a href="https://tenor.com/search/emoji-gifs">Emoji GIFs</a></div><script type="text/javascript" async src="https://tenor.com/embed.js"></script>
        <p>  
          Welcome to your tamagotchi
        </p>

      </header>
    </div>
  );
}

export default App;
